import React from 'react';
import {Header, Icon } from 'semantic-ui-react';
import Vikings from '../Video/Vikings.mp4';
import Got from '../Video/got.mp4';


const HeaderPart = () => {
    return (
        <React.Fragment>
            <Header as='h2' icon textAlign='center' style={{height:"500px", width:"100%"}}>
                <video autoPlay loop muted
                style={{
                    position: "absolute",
                    width : "100%",
                    height: "100%",
                    objectFit :"cover",
                    transform : "translate(-50%,-20%)"
                   // zIndex: "-1"
                }}
                >
                    <source src={Vikings} type="video/mp4"/>
                </video>
                <p>VIKINGS </p>
            </Header>
        </React.Fragment>
    )
}

export default HeaderPart;
